import React from "react";
import { Component } from "../../components/Component";
import { Caret } from "../../icons/Caret";
import { Icon1 } from "../../icons/Icon1";
import { Icon2 } from "../../icons/Icon2";
import { Icon7 } from "../../icons/Icon7";
import image8 from "../../img/image-108.png";
import rectangle from "../../img/rectangle-9.svg";
import rectangle7 from "../../img/rectangle-7-1.png";
import fullLogo2 from '../../img/fulllogo-transparent-nobuffer-2-2.png';
import fullLogo1 from '../../img/fulllogo-transparent-nobuffer-1-1.png';
import { IconPaginationPrev1 } from "../../icons/IconPaginationPrev1";
import line from '../../img/line-89-1.svg';
import next from '../../img/icon-pagination-next.svg';

import SidePanel from '../CompareProperty/SidePanel';

// Reusable SeparatorLine Component
const SeparatorLine = () => (
  <img
    className="w-[126px] h-[1px] my-4"
    alt="Separator Line"
    src="/img/line-91.svg"
  />
);

// LocalRentalMarketplace Component
const LocalRentalMarketplace = ({ rentals }) => (
  <div className="absolute w-[1015px] h-[1942px] top-[378px] left-[397px]">
    <div className="absolute top-[33px] left-8 font-semibold text-black text-[32px] leading-[20.4px] whitespace-nowrap">
      Local rental marketplace
    </div>
    <div className="relative w-[1013px] h-[1942px] rounded-[18px]">
      {rentals.map((rental, index) => (
        <PropertyCard key={index} {...rental} />
      ))}
    </div>
  </div>
);

// RentSuggestionCard Component
const RentSuggestionCard = ({ address, details, suggestedRent, rentRange }) => (
  <div className="absolute w-[1013px] h-[238px] top-[110px] left-[397px] rounded-[23.43px] bg-gradient-to-b from-[#b4e6f6] to-[#ffcc9f]">
    <div className="absolute w-[418px] h-[121px] top-[71px] left-[38px] flex flex-col items-start gap-[10.58px]">
      <div className="text-black text-[36.3px] leading-[37.8px] font-bold">
        {address}
      </div>
      <p className="text-black text-base leading-[normal] font-medium">
        {details}
